import React, {Component} from 'react';
import PopSearchHeader from './PopSearchHeader';
import YouTubeEmbed from '../../components/youtube-embed/YouTubeEmbed';
import './PopYoutubePageStyles.scss';

function PopYTpage(props) {
	console.log(props);
	const {videoId} = props;
	console.log(`${videoId}`);

	return(
		<div>
			<PopSearchHeader />
			<div className='youtube_container'>
				<YouTubeEmbed videoId={videoId} />
			</div>
		</div>
	);
}




